@Alfalfa1985 you asked about $JCSE and I think it’s got a good chance at moving higher soon. Here’s why:

That dip starting on the 31st and continuing through the 2nd was met with big increases in accumulationdistribution.  Accumulationdistribution is supposed to measure supply and demand. If demand is up, 99% of the time so is the price. But here we have demand up with the price down! That’s a sign that some larger pockets then you or me is buying 👀 

1.26 was met with a big relative vol spike, which gives us a Support signal. I think 1.19-1.24 is a smart SL and an average entry as close to that SL as possible is ideal Bullish
